let log = console.log

class Game extends Phaser.Scene {
    constructor() {
        super('game')
    }

    onClickDownload(){
        alert('your url here')
    }

    preload() {
        this.style1 = { font: ' 32px Arial', fill: "#ffffff",stroke: '#ffffff',strokeThickness:2};
        var bg = 'data:image/jpeg;base64,'
        this.load.image('bg', bg);
        this.load.image('hand', 'assets/hand.png');
        this.load.image('ctabtn', 'assets/ctabtn.png');
        this.load.image('logo', 'assets/logo.png');
        this.load.audio('music', 'assets/sport.mp3');
        //this.load.atlas('atlas', atlas, atlasJSON);
    }

    scaleSpriteTween (sprite, availableSpaceWidth, availableSpaceHeight, scaleMultiplier) {
        var scale = this.getSpriteScale(sprite.width, sprite.height, availableSpaceWidth, availableSpaceHeight);
        this.tweens.chain({targets: sprite, tweens:[{scale: {value:scale * (scaleMultiplier+0.2)}, duration: 400,  ease: 'sine.in'}, {scale: {value:scale * scaleMultiplier}, duration: 250,  ease: 'sine.out'}]}); 
    }

    scaleSprite (sprite, availableSpaceWidth, availableSpaceHeight, scaleMultiplier) {
        var scale = this.getSpriteScale(sprite.width, sprite.height, availableSpaceWidth, availableSpaceHeight);
        sprite.setScale(scale * scaleMultiplier);
    }

    getSpriteScale (spriteWidth, spriteHeight, availableSpaceWidth, availableSpaceHeight) {
        var ratio = 1;
        var currentDevicePixelRatio = window.devicePixelRatio;
        // Sprite needs to fit in either width or height
        var widthRatio = (spriteWidth * currentDevicePixelRatio + 2 ) / availableSpaceWidth;
        var heightRatio = (spriteHeight * currentDevicePixelRatio + 2 ) / availableSpaceHeight;
        if(widthRatio > 1 || heightRatio > 1){
            ratio = 1 / Math.max(widthRatio, heightRatio);
        }
        return ratio * currentDevicePixelRatio;
    }

    create() {
	  	this.cameras.main.setBackgroundColor(0x000000)
	    
	    this.setGameScene()
	   // this.setCTA()

	    this.scale.on('resize', this.resize, this)
        this.scale.resize(window.innerWidth,window.innerHeight)
    }

    setGameScene(){
        this.musicBg = this.sound.add('music');
        this.musicBg.play({loop:true, volume:0.3})

        this.mainVideo = this.add.video(window.innerWidth*0.5,window.innerHeight*0.5);
        this.mainVideo.loadURL('assets/tennis.mp4', true);

        this.mainVideo.setSize(1080, 1920)

        this.mark1 = this.mainVideo.addMarker('init',0,1)
        this.mark2 = this.mainVideo.addMarker('play1',1,4)
        this.mark3 = this.mainVideo.addMarker('play2',4,5.8)
        this.mark4 = this.mainVideo.addMarker('play3',5.8,8.6)
        this.mark5 = this.mainVideo.addMarker('play4',8.6,12)
        
        this.textTutorial = this.add.text(0, 0, 'TAP TO HIT THE BALL', this.style1).setOrigin(0.5).setScale(0.6).setAlpha(0)
        this.textTween = this.tweens.add({targets: this.textTutorial, angle:-3,duration: 300, yoyo:true,paused:true, repeat:-1, callbackScope: this ,ease: 'sine.inOut'})

        this.mainVideo.play();
        this.time.delayedCall(1000, this.tap1, [], this)

        this.input.once('pointerup',  function(){
             if (this.scale.isFullscreen) {
                this.scale.stopFullscreen();
            }
            else {
                this.scale.startFullscreen();
            }
        }, this)

        this.hand = this.add.sprite(0,0, 'hand').setScale(0.25).setAlpha(0)
        this.handTween = this.tweens.add({targets: this.hand, scale:{value:'-0.1'},duration: 500, yoyo:true,paused:true, repeat:-1, callbackScope: this ,ease: 'sine.inOut'})
        this.hand.setInteractive()

        this.bgCTA = this.add.sprite(0,0, 'bg').setOrigin(0.5).setAlpha(0)
        this.logoCTA = this.add.sprite(window.innerWidth*0.5, window.innerHeight*-1, 'logo').setOrigin(0.5).setScale(0.6).setAlpha(0)
        this.textCTA = this.add.text(0, 0, 'SWEAT\nSWING\nCONQUER ALL', this.style1).setOrigin(0.5).setScale(0.6).setAlpha(0).setAlign('center')

        //this.buttonContainer = this.add.container()
        this.buttonCTA = this.add.sprite(0,0, 'ctabtn').setOrigin(0.5).setScale(0.6).setAlpha(0)
        //this.buttonContainer.add(this.buttonCTA)
        //this.buttonContainer.setScale(0.6).setAlpha(0)
        //Phaser.Display.Align.In.Center(this.buttonContainer,this.add.zone(window.innerWidth*0.5, window.innerHeight*0.65, window.innerWidth, window.innerHeight));
    }

    pauseVideo(){
        this.mainVideo.pause()
        this.hand.setAlpha(1)
        this.textTutorial.setAlpha(1)
        this.handTween.paused = false
        this.textTween.paused = false
    }

    tap1(){
        this.pauseVideo()
        this.hand.once('pointerdown', this.firstEvent, this);
    }

    tap2(){
        this.pauseVideo()
        this.hand.once('pointerdown', this.firstEvent2, this);
    }

    tap3(){
        this.pauseVideo()
        this.hand.once('pointerdown', this.firstEvent3, this);
    }

    tap4(){
        this.pauseVideo()
        this.hand.once('pointerdown', this.firstEvent4, this);
    }

    firstEvent(){
        this.handTween.paused = true
        this.hand.alpha = 0
        this.textTutorial.alpha = 0
        this.mainVideo.resume()
        this.time.delayedCall(3000, this.tap2, [], this)
    }

    firstEvent2(){
        this.handTween.paused = true
        this.hand.alpha = 0
        this.textTutorial.alpha = 0
        this.mainVideo.resume()
        this.time.delayedCall(1800, this.tap3, [], this)
    }

    firstEvent3(){
        this.handTween.paused = true
        this.hand.alpha = 0
        this.textTutorial.alpha = 0
        this.mainVideo.resume()
        this.time.delayedCall(2800, this.tap4, [], this)
    }

    firstEvent4(){
        this.handTween.paused = true
        this.hand.alpha = 0
        this.textTutorial.alpha = 0
        this.mainVideo.resume()
        this.time.delayedCall(3400, this.startCTA, [], this)
    }

    setCTA(){
        
    }
  
    startCTA(){
        this.hand.setAlpha(0)
        this.textTutorial.setAlpha(0)
        this.handTween.paused = true
        this.textTween.paused = true

        this.logoCTA.setAlpha(1)
        this.tweens.add({targets: [this.bgCTA], alpha:1, duration: 500,  ease: 'sine.inOut'});
        
        this.tweens.add({targets: this.logoCTA, y: window.innerHeight*0.25, duration: 500,  ease: 'sine.inOut',
            onComplete:()=>{
                this.textCTA.y = this.logoCTA.y + this.logoCTA.displayHeight 
                this.buttonCTA.y = this.textCTA.y + this.textCTA.displayHeight
                this.tweens.add({targets: [this.buttonCTA,this.textCTA], alpha:1, duration: 500,  ease: 'sine.inOut'});
            }
        });

        this.tweens.add({targets: this.buttonCTA, scale:{value:0.5}, duration: 500,  ease: 'sine.inOut',
            onComplete:()=>{
                this.tweens.add({targets: this.buttonCTA, scale: {value: this.buttonCTA.scaleX+0.05}, duration: 800,  ease: 'sine.inOut', yoyo:true, loop:-1}); 
            }
        }); 

        this.input.on('pointerdown', this.onClickDownload)
    }

    resize (gameSize, baseSize, displaySize, resolution){
        const width = gameSize.width;
        const height = gameSize.height;
        var isLandscape = height / width  < 1.3 ? true: false;

        this.bgCTA.displayWidth = width
        this.bgCTA.displayHeight = height
        this.bgCTA.x = width*0.5
        this.bgCTA.y = height*0.5

        this.textTutorial.x = width*0.5
        this.textTutorial.y = height*0.3

        this.textCTA.x = width*0.5
        //this.textCTA.y = height*0.3 + this.logoCTA.displayHeight

        this.logoCTA.x = width*0.5

        this.buttonCTA.x = width*0.5
        //this.buttonCTA.y = this.textCTA.y + this.textCTA.displayHeight

        //GAME
        if(!isLandscape){
            this.mainVideo.setDisplaySize(width, height)
            this.mainVideo.x = width*0.5
            this.mainVideo.y = height*0.5

            this.logoCTA.y = height*0.25
            this.textCTA.y = this.logoCTA.y + this.logoCTA.displayHeight 
            this.buttonCTA.y = this.textCTA.y + this.textCTA.displayHeight

            this.hand.setPosition(window.innerWidth*0.8,window.innerHeight*0.9)
           
        }
        else{
            this.mainVideo.displayWidth = width*0.5
            this.mainVideo.displayHeight = height
            this.mainVideo.x = width*0.5
            this.mainVideo.y = height*0.5

            this.logoCTA.y = height*0.2
            this.textCTA.y = this.logoCTA.y + this.logoCTA.displayHeight 
            this.buttonCTA.y = this.textCTA.y + this.textCTA.displayHeight

            this.hand.setPosition(window.innerWidth*0.65,window.innerHeight*0.9)
        }
    }       
}

let config = {
    type: Phaser.WEBGL,
    scene: Game,
    scale: {
       mode: Phaser.Scale.RESIZE,
       autoCenter: Phaser.Scale.CENTER_BOTH,
       width: window.innerWidth,
       height: window.innerHeight,
       autoRound: true,
       antialias: true
    },
    fps: {
        target: 60,
        minFps: 30
    },
}
new Phaser.Game(config)